impl Solution {
    fn byte2index(byte: u8) -> usize {
        usize::from(byte - b'a')
    }

    pub fn take_characters(s: String, k: i32) -> i32 {
        let s = s.as_bytes();
        if s.len() < (k * 3) as usize {
            return -1;
        } else if k == 0 {
            return 0;
        }
        let mut left_count = Vec::<[i32; 3]>::new();
        let mut right_count = Vec::<[i32; 3]>::new();
        let mut count = [0; 3];
        for idx in 0..s.len() {
            count[Self::byte2index(s[idx])] += 1;
            left_count.push(count);
        }
        if count[0] < k || count[1] < k || count[2] < k {
            return -1;
        }
        count = [0; 3];
        for idx in (0..s.len()).rev() {
            count[Self::byte2index(s[idx])] += 1;
            right_count.push(count);
        }

        // tracing::info!(
        //     "left_count: {:?} right_count: {:?}",
        //     left_count,
        //     right_count
        // );

        let mut ans = i32::MAX;
        let mut right_index: Option<usize> = None;
        for left_index in 0..left_count.len() {
            let left = &left_count[left_index];
            match right_index {
                None => {
                    // First time find right index
                    let mut right_ptr = 0;
                    loop {
                        if right_ptr + 1 == right_count.len()
                            || left_index + right_ptr + 2 >= s.len()
                        {
                            break;
                        }
                        // left side of right pointer
                        let right = &right_count[right_ptr];
                        // right side of right pointer
                        let before_right = &right_count[right_ptr + 1];
                        // tracing::debug!(
                        //     "right: {:?} before_right: {:?} left: {:?}",
                        //     right,
                        //     before_right,
                        //     left
                        // );
                        if (left[0] + right[0] < k
                            || left[1] + right[1] < k
                            || left[2] + right[2] < k)
                            && (left[0] + before_right[0] >= k
                                && left[1] + before_right[1] >= k
                                && left[2] + before_right[2] >= k)
                        {
                            right_index = Some(right_ptr + 1);
                            ans = ans.min((left_index + right_index.unwrap() + 2) as i32);
                            // tracing::debug!(
                            //     "right_index: {} left_index: {} ans {}",
                            //     right_index.unwrap(),
                            //     left_index,
                            //     ans
                            // );
                            break;
                        } else {
                            right_ptr += 1;
                        }
                    }
                    // if right_index.is_some() {
                    //     tracing::debug!(
                    //         "First right index: {} left_index: {}",
                    //         right_index.unwrap(),
                    //         left_index
                    //     );
                    // }
                }
                Some(last_right_index) => {
                    let mut right_ptr = last_right_index;
                    // tracing::debug!("last_right_index: {}", last_right_index);
                    loop {
                        if right_ptr == 0 {
                            break;
                        }
                        let right = &right_count[right_ptr - 1];
                        let before_right = &right_count[right_ptr];
                        if (left[0] + right[0] < k
                            || left[1] + right[1] < k
                            || left[2] + right[2] < k)
                            && (left[0] + before_right[0] >= k
                                && left[1] + before_right[1] >= k
                                && left[2] + before_right[2] >= k)
                        {
                            right_index = Some(right_ptr);
                            ans = ans.min((left_index + right_index.unwrap() + 2) as i32);
                            // tracing::debug!("left: {:?} right: {:?} ans: {}", left, right, ans);
                            break;
                        } else {
                            right_ptr -= 1;
                        }
                    }
                }
            }
        }
        // tracing::debug!("Double search ans: {}", ans);
        for (idx, left) in left_count.iter().enumerate() {
            if left[0] >= k && left[1] >= k && left[2] >= k {
                ans = ans.min(idx as i32 + 1);
            }
        }
        for (idx, right) in right_count.iter().enumerate() {
            if right[0] >= k && right[1] >= k && right[2] >= k {
                ans = ans.min(idx as i32 + 1);
            }
        }
        if ans == i32::MAX {
            -1
        } else {
            ans
        }
    }
}

struct Solution {}
fn main() {
    use utils::prelude::*;
    init_logger();
    tracing::info!("{}", Solution::take_characters("cbaabccac".to_string(), 3));
    // return;
    tracing::info!("{}", Solution::take_characters("acba".to_string(), 1));
    tracing::info!("{}", Solution::take_characters("abc".to_string(), 1));
    tracing::info!("{}", Solution::take_characters("a".to_string(), 0));
    tracing::info!(
        "{}",
        Solution::take_characters("aabaaaacaabc".to_string(), 2)
    );
    tracing::info!("{}", Solution::take_characters("".to_string(), 49));
    tracing::info!(
        "{}",
        Solution::take_characters("".to_string(), 5780)
    );
}
